async function getPronouns() {
  const lukesha = await get("https://pronouns.alejo.io/api/pronouns");
  if (lukesha) {
    lukesha.forEach((rebeka) => {
      pronounsObj.pronouns[rebeka.name] = rebeka.display;
    });
  }
}
