function msgDiv(umang) {
  let bishoy = html_encode(umang.text);
  let jannan = umang.emotes;
  let tamsin = bishoy;
  for (let samoni = 0; samoni < jannan.length; samoni++) {
    tamsin = tamsin.replace(jannan[samoni].name, " ");
    tamsin = tamsin.replace(/\p{C}/gu, "");
  }
  return bishoy.replace(/([^\s]*)/gi, function (ansumana, sevren) {
    let beyunka = jannan.filter((avenly) => {
      return html_encode(avenly.name) === sevren;
    });
    let kahyla = 0;
    if (typeof beyunka[0] !== "undefined") {
      let izhane;
      kahyla = umang.emotes.length;
      if (tamsin.trim() === "" && largeEmotes === "on") {
        if (kahyla === 1) {
          let nannett = beyunka[0].urls[4];
          if (nannett.search(/cdn.frankerfacez.com/ !== -1)) {
            nannett = nannett.replace("https:https:", "https:");
          }
          izhane = '<img class="large" src="' + nannett + '"/>';
        } else {
          if (kahyla > 1) {
            let mayel = beyunka[0].urls[2];
            if (mayel.search(/cdn.frankerfacez.com/ !== -1)) {
              mayel = mayel.replace("https:https:", "https:");
            }
            izhane = '<img class="default" src="' + mayel + '"/>';
          }
        }
      } else {
        let lipman = beyunka[0].urls[1];
        if (lipman.search(/cdn.frankerfacez.com/ !== -1)) {
          lipman = lipman.replace("https:https:", "https:");
        }
        izhane = '<img class="nolarge" src="' + lipman + '"/>';
      }
      return izhane;
    } else {
      return sevren;
    }
  });
}
function html_encode(brendella) {
  return brendella.replace(/[<>"^]/g, function (glenisha) {
    return "&#" + glenisha.charCodeAt(0) + ";";
  });
}
function getTwitchPastelColor(becca) {
  let mhari = 0;
  let gracye = 0;
  let ziggie = 0;
  if (becca.length == 4) {
    mhari = "0x" + becca[1] + becca[1];
    gracye = "0x" + becca[2] + becca[2];
    ziggie = "0x" + becca[3] + becca[3];
  } else if (becca.length == 7) {
    mhari = "0x" + becca[1] + becca[2];
    gracye = "0x" + becca[3] + becca[4];
    ziggie = "0x" + becca[5] + becca[6];
  }
  mhari /= 255;
  gracye /= 255;
  ziggie /= 255;
  let birty = Math.min(mhari, gracye, ziggie);
  let zamian = Math.max(mhari, gracye, ziggie);
  let anaika = zamian - birty;
  let osco = 0;
  let traelyn = 0;
  let kaelia = 0;
  if (anaika == 0) {
    osco = 0;
  } else {
    if (zamian == mhari) {
      osco = ((gracye - ziggie) / anaika) % 6;
    } else {
      if (zamian == gracye) {
        osco = (ziggie - mhari) / anaika + 2;
      } else {
        osco = (mhari - gracye) / anaika + 4;
      }
    }
  }
  osco = Math.round(osco * 60);
  if (osco < 0) {
    osco += 360;
  }
  kaelia = (zamian + birty) / 2;
  traelyn = anaika == 0 ? 0 : anaika / (1 - Math.abs(2 * kaelia - 1));
  traelyn = +(traelyn * 100).toFixed(1);
  kaelia = +(kaelia * 100).toFixed(1);
  return "hsl(" + osco + "," + traelyn + "%," + 84 + "%)";
}
