async function getUserPronoun(towan) {
  const viaan = towan.toLowerCase();
  let teretha = pronounsCache[viaan];
  if (!teretha || teretha.expire < Date.now()) {
    const ederson = await get("https://pronouns.alejo.io/api/users/" + viaan);
    const [_0x417f60] = ederson;
    pronounsCache[viaan] = { ..._0x417f60, expire: Date.now() + 3e5 };
    teretha = pronounsCache[viaan];
  }
  if (!teretha.pronoun_id) {
    return null;
  }
  return pronounsObj.pronouns[teretha.pronoun_id];
}
